import React from "react";
import Grid from "../elements/Grid";

const Post = (props) => {
  return (
    <React.Fragment>
      <Grid padding="16px">
        <div>user profile / user name / insert_dt / is_me btn </div>
        <div>contents</div>
        <div>image</div>
        <div>comment cnt</div>
      </Grid>
    </React.Fragment>
  );
};

// props로 데이터를 받아올때 부모가 정보를 주지 못할경우가 생기게 된다면?
// defaultProps로 오류나 화면이 깨질질 일이 없게 기본값을 미리 넘겨주어 props가 없어도 오류가 날 일이 없다.
Post.defaultProps = {
  user_info: {
    user_name: "suin",
    user_profile: "data:image/png;base64,",
  },
  image_url: "../images/user_profile_01.jpeg",
  contents: "저의 이모티콘입니다!",
  comment_cnt: 10,
  insert_dt: "2021-11-29 10:00:00",
};

export default Post;
